import React from 'react'

export default function List({ items }) {

       const display =  items.map( ({label, value })=>{
               return <li> 
                   <strong>{label}</strong>
                     {value}
               </li> 
        } )
    return (
        <ul>
            {display}
        </ul>
    )
}
